import { useState } from "react";
import { Image, FileText, File, Loader2 } from "lucide-react";

const Display = ({ contract, account }) => {
  const [data, setData] = useState("");
  const [loading, setLoading] = useState(false);

  // Function to detect file type from IPFS URL
  const detectFileType = async (ipfsHash) => {
    try {
      const response = await fetch(`https://gateway.pinata.cloud/ipfs/${ipfsHash}`, {
        method: 'HEAD'
      });
      const contentType = response.headers.get('content-type');
      
      if (contentType?.startsWith('image/')) {
        return 'image';
      } else if (contentType === 'application/pdf') {
        return 'pdf';
      }
      return 'other';
    } catch (error) {
      console.error('Error detecting file type:', error);
      return 'other';
    }
  };

  // Function to render appropriate icon based on file type
  const FileTypeIcon = ({ type, className }) => {
    switch (type) {
      case 'image':
        return <Image className={className} size={24} />;
      case 'pdf':
        return <FileText className={className} size={24} />;
      default:
        return <File className={className} size={24} />;
    }
  };

  const getdata = async () => {
    setLoading(true);
    let dataArray;
    const Otheraddress = document.querySelector(".address").value;
    
    try {
      if (Otheraddress) {
        dataArray = await contract.display(Otheraddress);
      } else {
        dataArray = await contract.display(account);
      }
    } catch (e) {
      alert("You don't have access");
      setLoading(false);
      return;
    }

    const isEmpty = Object.keys(dataArray).length === 0;

    if (!isEmpty) {
      const str = dataArray.toString();
      const str_array = str.split(",");
      
      // Process each file and determine its type
      const processedFiles = await Promise.all(
        str_array.map(async (item) => {
          const ipfsHash = item.substring(6);
          const fileType = await detectFileType(ipfsHash);
          return { url: item, type: fileType, hash: ipfsHash };
        })
      );

      // Create elements with appropriate icons
      const fileElements = processedFiles.map((file, i) => (
        <div key={i} className="file-container p-2 border rounded-lg hover:bg-gray-50">
          <a
            href={file.url}
            target="_blank"
            rel="noopener noreferrer"
            className="flex items-center gap-2"
          >
            <FileTypeIcon type={file.type} className="text-blue-500" />
            {file.type === 'image' && (
              <img
                src={`https://gateway.pinata.cloud/ipfs/${file.hash}`}
                alt="preview"
                className="w-16 h-16 object-cover rounded"
              />
            )}
            <span className="text-sm text-gray-600">
              {file.type === 'image' ? 'Image' : file.type === 'pdf' ? 'PDF Document' : 'File'}
            </span>
          </a>
        </div>
      ));

      setData(fileElements);
    } else {
      alert("No files to display");
    }
    setLoading(false);
  };

  return (
    <div className="p-4">
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4 mb-4">
        {data}
      </div>
      <div className="flex gap-2 items-center justify-center">
        <input
          type="text"
          placeholder="Enter Address"
          className="address p-2 border rounded"
        />
        <button
          className="flex items-center gap-2 px-4 py-2 bg-blue-500 text-white rounded hover:bg-blue-600 disabled:bg-blue-300"
          onClick={getdata}
          disabled={loading}
        >
          {loading && <Loader2 className="animate-spin" size={16} />}
          Get Data
        </button>
      </div>
    </div>
  );
};

export default Display;


